package com.amandris.clients.web.form;import java.io.Serializable;import org.apache.struts.validator.ValidatorForm;public class AdminCensorSellerForm extends ValidatorForm implements Serializable{	private String id;	private String login;	private String name;	private String surname;	private String address1;	private String address2;	private String city;	private String postalCode;	private String intro;	private String text;	private String preferredText;			private static final long serialVersionUID = 95994437232567100L;	public String getAddress1() {		return address1;	}	public void setAddress1(String address1) {		this.address1 = address1;	}	public String getAddress2() {		return address2;	}	public void setAddress2(String address2) {		this.address2 = address2;	}	public String getCity() {		return city;	}	public void setCity(String city) {		this.city = city;	}		public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getIntro() {		return intro;	}	public void setIntro(String intro) {		this.intro = intro;	}	public String getLogin() {		return login;	}	public void setLogin(String login) {		this.login = login;	}		public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getPostalCode() {		return postalCode;	}	public void setPostalCode(String postalCode) {		this.postalCode = postalCode;	}	public String getPreferredText() {		return preferredText;	}	public void setPreferredText(String preferredText) {		this.preferredText = preferredText;	}	public String getSurname() {		return surname;	}	public void setSurname(String surname) {		this.surname = surname;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}	}